(3, '1', 'Rafting', 'Descienda por nuestro turbulento río.', '234', '2342', 'Es una práctica habitual entre los turistas que llegan a nuestra ciudad, y para amantes del turismo aventura, es una actividad grupal que permite conocer la belleza de Valle Grande desde sus adentros, impulsándose con remos contando siempre con la ayuda de un guía, descendienda a través de sus inquietantes aguas podremos explorar paisajes inaccesibles por otros medios. El Río Atuel ofrece la máxima oferta para realizar esta actividad. <br>', '----', '10.56', '12', '12', 4, 4, 2, '2018-06-27 06:13:37', '2018-07-29 03:23:30'),
