(7, '0', 'Ducky', 'sdfsd', '234', '2342', '<p>Es un una embarcación diseñada para una o dos persona \r\nsiempre acompañadas de un guia. El impulso esta dado por medio de un remo \r\ndoble.  Rápidamente podrás \r\ndescender en el río, teniendo la posibilidad de apreciar la belleza \r\ndesde el agua.<br></p>', '--', '1.98', '1', '1', 4, 4, 2, '2018-06-30 04:02:50', '2018-08-12 00:37:46'),
