(13, '1', 'Catamaran', 'Embárquese en la aventura.', '234', '2342', 'Navegue sobre el inmenso espejo de agua verde que ofrece la\r\nrepresa de Valle Grande, desde ahí podrá visitar las playas de Valle Grande,\r\nalimentado por el Río Atuel que nace en su laguna homónima a la vera de la\r\ncordillera de los Andes, rodeado de cerros y una pared de cemento, disfrutara la belleza de un paisaje inmesurable.', '--', '0.88', '12', '12', 4, 2, 2, '2018-06-30 04:22:10', '2018-07-29 03:25:19'),
(14, '1', 'Paseo en Canoas', '¡Describí vistas que solo la canoa te puede mostrar!', '240', '-', '<p>Sencilla actividad con el equilibrio justo entre emocion y seguridad. Presenta el imponente embalse Valle Grande desde dentro, mostrando increibles vistas que solo se ven desde el Agua. <br></p><p>El cómodo bote, permite a toda la familia navegar las aguas del lago y cruzar a las playas del embalse, donde se puede disfrutar de distintas actividades.</p><p>¡Remá hacia la aventura!<br></p>', 'Vestimenta: Ropa deportiva o comoda, gorra o sombrero, anteojos de sol.', '1.76', '1', '12', 4, 4, 2, '2018-06-30 04:23:10', '2018-07-29 03:24:04');
