INSERT INTO `informaciones` (`id`, `state`, `title`, `descripcion`, `user_id`, `category_id`, `created_at`, `updated_at`) VALUES
(1, '1', 'Espejo de Agua', '<p> Alimentado por el Río Atuel, la represa forma uno de los atractivos turisticos mas visitados de departamento sanrafelino. Inagurada un 2 de octubre de 1965, por el presidente Arturo Illia, este paredon de 115 m. tiene una 164 hm3, con un volumen útil de 162,20 hm3.</p><p>Ubicado a 37 km del cento de San Rafael y adentrandose en el Cañon Atuel llegando al mismo por la ruta provincial 173.</p><p>A la vera de este espejo de agua se realizan diversas actividades tales como rafting, canotaje, natacion, pesca entre otras. Dandole vida a toda la actividad turistica que este desprende. Mas alla de la diversion y el descanso el dique forma parte de una cadenas de centrales hidroelecticas llamada Nihuil I, II, III y IV, ademas sus aguas son utilizadas para el riego de cultivos. <br></p><p>En su interior se puede acceder por medio de catamaran a las playas de Valle Grande, una extencion de arena al pie de la montaña. <br></p>', 4, 2, '2018-07-08 11:05:48', '2018-07-23 14:16:01'),
(2, '0', 'La mejor experiencia en espejos de agua', '<p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p><p>La mejor experiencia en espejos de agua</p>', 2, 2, '2018-07-23 14:15:03', '2018-07-23 14:15:03');
